import WallpaperitLogo from "../../img/wallpaperit-Logo.png"

function Header() {
    return (
        <div className="header">
            <img src="img/wallpaperit-Logo.png" className="header-logo" alt="Wallpaperit Logo" />
            <div className="header-icons">
                <a href="#">
                    <img src="img/sign in.png" alt="Sign in">Sign in</img>
                </a>
                <a href="#">
                    <img src="img/wishlist.png" alt="Wishlist">Wishlist</img>
                </a>
                <a href="#">
                    <img src="img/bag.png" alt="Bag">Bag</img>
                </a>
            </div>
        </div>
    );
}

export default Header;
